  `root_id` int(11) NOT NULL,
  `time` datetime DEFAULT NULL,
  `type` enum('message','system','betstate','abort','report') NOT NULL,
  `message_id` int(11) DEFAULT NULL,
  `game_id` int(11) DEFAULT NULL,
  `text` text,
  `newstate` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `message_id` (`message_id`),
  KEY `game_id` (`game_id`),
  KEY `ix_event_root_id` (`root_id`),
