  CONSTRAINT `event_ibfk_1` FOREIGN KEY (`root_id`) REFERENCES `game` (`id`),
  CONSTRAINT `event_ibfk_2` FOREIGN KEY (`message_id`) REFERENCES `chat_message` (`id`),
  CONSTRAINT `event_ibfk_3` FOREIGN KEY (`game_id`) REFERENCES `game` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=318 DEFAULT CHARSET=utf8;
