--
-- Table structure for table `game`
--

DROP TABLE IF EXISTS `game`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `game` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `creator_id` int(11) DEFAULT NULL,
  `opponent_id` int(11) DEFAULT NULL,
  `parent_id` int(11) DEFAULT NULL,
  `gamertag_creator` varchar(128) DEFAULT NULL,
  `gamertag_opponent` varchar(128) DEFAULT NULL,
  `twitch_handle` varchar(64) DEFAULT NULL,
  `twitch_identity_creator` varchar(128) DEFAULT NULL,
  `twitch_identity_opponent` varchar(128) DEFAULT NULL,
  `gametype` varchar(64) NOT NULL,
  `gamemode` varchar(64) NOT NULL,
  `meta` text,
  `bet` float NOT NULL,
  `create_date` datetime DEFAULT NULL,
  `state` enum('new','cancelled','accepted','declined','finished','aborted') DEFAULT NULL,
  `accept_date` datetime DEFAULT NULL,
  `aborter_id` int(11) DEFAULT NULL,
  `winner` enum('creator','opponent','draw') DEFAULT NULL,
  `details` text,
  `finish_date` datetime DEFAULT NULL,
  `tournament_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_game_creator_id` (`creator_id`),
  KEY `ix_game_opponent_id` (`opponent_id`),
  KEY `ix_game_parent_id` (`parent_id`),
  KEY `ix_game_aborter_id` (`aborter_id`),
  KEY `ix_game_tournament_id` (`tournament_id`),
  CONSTRAINT `game_ibfk_1` FOREIGN KEY (`creator_id`) REFERENCES `player` (`id`),
  CONSTRAINT `game_ibfk_2` FOREIGN KEY (`opponent_id`) REFERENCES `player` (`id`),
  CONSTRAINT `game_ibfk_3` FOREIGN KEY (`parent_id`) REFERENCES `game` (`id`),
  CONSTRAINT `game_ibfk_4` FOREIGN KEY (`aborter_id`) REFERENCES `player` (`id`),
  CONSTRAINT `game_ibfk_5` FOREIGN KEY (`tournament_id`) REFERENCES `tournament` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=230 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

